--
-- Name: vw_transaction_status; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_transaction_status AS
 SELECT a.isostatusid,
    a.isoid,
    a.partnerid,
    a.channel,
    a.partnerref,
    a.sourcecountry,
    a.oldref,
    a.bridgeref,
    a.currency,
    a.amount,
    a.prevstatus,
    a.isostatus,
    a.description,
    a.datetimeadded,
    a.addedby,
    a.ipaddress,
    e.res_field48 AS finalstatus
   FROM ((public.tbl_iso_status a
     LEFT JOIN public.tbl_trn_transactions d ON (((a.bridgeref)::text = (d.transaction_number)::text)))
     LEFT JOIN public.tbl_sys_iso e ON ((a.isoid = e.iso_id)))
  WHERE ((e.res_field48)::text = ANY ((ARRAY['COMPLETED'::character varying, 'FAILED'::character varying])::text[]))
  ORDER BY a.isostatusid;


